  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:40.685310\",\n\t\"name\": \"biological-review-of-the-refuges-in-the-lower-great-lakes-st-lawrence-plain\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To promote a more efficient and effective
  biological review process, a multi-refuge biological review was conducted at four
  National Wildlife Refuges: Erie, Iroquois, Montezuma, and Missisquoi. These Refuges
  were selected based on their physiographic location and inclusion in Bird Conservation
  Region. These refuges have similar conservation priorities, resources of concern,
  habitat types, and management strategies. This report is based on the following
  objectives: 1) Review of current and potential biological objectives at each refuge.
  2). Identification of contributions individual refuges can make towards Regional
  and National plans such as Bird Conservation Region, Partners in Flight Plans, North
  American Waterfowl Management Plan and Shorebird Plans. 3) Discussion of management
  actions conducted at each refuge and how current management programs contribute
  to various wildlife and habitat objectives. 4). Discussion of the highest contribution
  of each refuge to wildlife and habitat resources with an emphasis on controversial
  issues the refuge faces such as mosquito control, cormorants, flooding, and invasive
  species. 5). Discussion of the effectiveness of management actions.\",\n\t\"license_title\":
